@keyframes advance {
    0% { right: 0%; }
  100% { right: 110%; }
}
@keyframes walk {
    0% { transform: rotate(0deg); }
   25% { transform: rotate(20deg); }
   50% { transform: rotate(0deg); }
   75% { transform: rotate(-20deg); }
  100% { transform: rotate(0deg); }
}
@keyframes fly {
    0% { left: 12.25vmin; }
  100% { left: 200vw; }
}
@keyframes fall {
    0% { top: 3vmin; }
  100% { top: 22vmin; }
}
@keyframes bang-1 {
    0% { width: 3.85vmin; height: 3.85vmin; }
  100% { width: 11vmin; height: 11vmin; }
}
@keyframes bang-2 {
    0% { opacity: 1; }
   30% { opacity: 1; }
  100% { opacity: 0; }
}
@keyframes roll {
    0% { transform: translate(-50%, -50%) rotate(0deg); }
  100% { transform: translate(-50%, -50%) rotate(360deg); }
}
@keyframes girl {
    0% { transform: rotate(0deg); }
   20% { transform: rotate(0deg); }
   50% { transform: rotate(-8deg); }
   80% { transform: rotate(0deg); }
  100% { transform: rotate(0deg); }
}
@keyframes heart {

		var bombostrels = row.getElementsByClassName('bombostrel');
		var enemies = row.getElementsByClassName('enemy');
		var hasEnemyInView = enemies.length && enemies[0].offsetLeft < window.innerWidth;
		for (bombostrel of bombostrels) {
			bombostrel.myDelay = Math.max(bombostrel.myDelay - 1, 0) || 0;
			if (!bombostrel.myDelay && hasEnemyInView) {
				bombostrel.insertAdjacentHTML('afterend', '<SPAN class="bomb"></SPAN>');
				bombostrel.myDelay = bombostrel.classList.contains('elite') ? 50 : 100;
			}
		}
		var spikes = row.getElementsByClassName('spikes');
		for (var enemy of enemies) {
			for (var spike of spikes) {
				if (enemy.offsetLeft + enemy.offsetWidth / 2 < spike.offsetLeft + spike.offsetWidth && enemy.offsetLeft + enemy.offsetWidth / 2 > spike.offsetLeft) {
					enemy.mySpikesDelay = (enemy.mySpikesDelay - 1) || 0;
					if (enemy.mySpikesDelay <= 0) {
						enemy.myHitPoints -= 5;
						enemy.animate({ filter: ['brightness(1)', 'brightness(999)', 'brightness(1)'] }, { duration: 20 });
						enemy.mySpikesDelay = spike.classList.contains('elite') ? 16 : spike.classList.contains('advanced') ? 32 : 48;
					}
					if (enemy.myHitPoints <= 0) enemy.remove(), addCoins(1, true);
				}
			}
		}
		var enemies = row.getElementsByClassName('enemy');
		var bombs = row.getElementsByClassName('bomb');
		for (var bomb of bombs) {
			if (bomb.classList.contains('bang')) continue;
			for (var enemy of enemies) {
				if (enemy.offsetLeft < bomb.offsetLeft && bomb.offsetLeft + bomb.offsetWidth < enemy.offsetLeft + enemy.offsetWidth) {
					bomb.classList.add('bang');
					enemy.myHitPoints = enemy.myHitPoints || 100;
					enemy.myHitPoints -= 10;
					enemy.animate({ filter: ['brightness(1)', 'brightness(999)', 'brightness(1)'] }, { duration: 20 });
					if (enemy.myHitPoints <= 0) enemy.remove(), addCoins(1, true);
				}
			}
		}
		var enemies = row.getElementsByClassName('enemy');
		var hearts = row.getElementsByClassName('heart');
		for (var heart of hearts) {
			for (var enemy of enemies) {
				if (enemy.offsetLeft < heart.offsetLeft && heart.offsetLeft + heart.offsetWidth < enemy.offsetLeft + enemy.offsetWidth) {
					heart.remove();
					enemy.myHitPoints = enemy.myHitPoints || 100;
					enemy.myHitPoints -= 10;
					enemy.animate({ filter: ['brightness(1)', 'brightness(999)', 'brightness(1)'] }, { duration: 20 });
					if (enemy.myHitPoints <= 0) enemy.remove(), addCoins(1, true);

        if (enemies.length > 1 && !document.getElementsByClassName('girl').length && document.body.offsetWidth * 0.84 < right && right < document.body.offsetWidth * 0.85) {
			var capture = row; // Cannot use loop variable in setTimeout()
			row.insertAdjacentHTML('beforeend', '<SPAN class="girl"></SPAN>');
			setTimeout(function () { capture.insertAdjacentHTML('beforeend', '<SPAN class="heart heart-1"></SPAN>'); }, 150);
			setTimeout(function () { capture.insertAdjacentHTML('beforeend', '<SPAN class="heart heart-2"></SPAN>'); }, 450);
			setTimeout(function () { capture.insertAdjacentHTML('beforeend', '<SPAN class="heart heart-3"></SPAN>'); }, 750);
			setTimeout(function () { capture.insertAdjacentHTML('beforeend', '<SPAN class="heart heart-4"></SPAN>'); }, 1050);
			setTimeout(function () { capture.insertAdjacentHTML('beforeend', '<SPAN class="heart heart-5"></SPAN>'); }, 1350);
		}
		var enemies = row.getElementsByClassName('enemy');
		var lastEnemy = enemies[enemies.length - 1];
		var girl = row.getElementsByClassName('girl')[0];
		if (document.myExtraEnemies && !girl && (!lastEnemy || lastEnemy.offsetLeft < document.body.offsetWidth * difficulty)) {
			var rnd = Math.random() * 3;
			var spd = '';
			if (rnd < 1 && (!lastEnemy || lastEnemy.classList.contains('veryfast'))) spd += ' veryfast'; else if (rnd < 2 && (!lastEnemy || lastEnemy.classList.contains('fast'))) spd += ' fast';
			row.insertAdjacentHTML('beforeend', '<SPAN class="enemy enemy-a' + spd + '"></SPAN>');
			document.myExtraEnemies -= 1;
		}
    }
	if (!document.getElementsByClassName('enemy').length) {
		document.body.classList.add('victorious');
		if (!document.body.classList.contains('had-losses') && !document.body.classList.contains('bad-losses')) {
